import React from "react";
// import Meal from "./Meal";

export default function Food({ foodData }) {
    const { category, nutrition } = foodData
    // console.log(mealData);

    return (
        <main>
            <section className="nutrients">
                <h1>This food has <span style={{color: 'Aqua', fontSize: '1.2em'}}>{category.probability.toFixed(2)}</span> chance of being <span style={{color: 'red', fontSize: '1.5em'}}>{category.name}</span></h1>
                <ul style={{color: 'white'}}>
                    <li>Calories: {nutrition.calories.value.toFixed(0)} {nutrition.calories.unit}</li>
                    <li>Carbohydrates: {nutrition.carbs.value.toFixed(0)}</li>
                    <li>Fat: {nutrition.fat.value.toFixed(0)}</li>
                    <li>Protein: {nutrition.protein.value.toFixed(0)}</li>
                </ul>
            </section>
            {/* <section className="meals">
                {mealData.meals.map((meal) => {
                    return <Meal key={meal.id} meal={meal} />
                })}
            </section> */}
        </main>
    )
}
